import React, { useRef, useState } from "react";
import Anchor from "../../components/Anchor";
import OAuth from "../../components/Buttons/OAuth";
import Primary from "../../components/Buttons/Primary";
import Heading from "../../components/Heading";
import InputHandler from "../../components/InputHandler";
import facebook from "../../assets/icons/facebook.png";
import google from "../../assets/icons/google.png";

const SignIn = () => {
  const [formData, setFormData] = useState({});
  const formRef = useRef();
  console.log(formData);

  const submitHandler = (e) => {
    e.preventDefault();

    //Handle submit here
  };

  return (
    <form>
      <Heading>Login to OwnIt</Heading>
      <InputHandler
        placeholder="Email"
        type="email"
        name="email"
        onChange={(e) => {
          setFormData({ ...formData, email: e.target.value });
        }}
      />
      <InputHandler
        placeholder="Password"
        type="password"
        name="password"
        onChange={(e) => {
          setFormData({ ...formData, password: e.target.value });
        }}
      />
      <Anchor>Forgot Password?</Anchor>
      <Primary onClick={submitHandler}>Login</Primary>
      <div>
        New to OwnIt: <Anchor>SignUp</Anchor>
      </div>
      <div>
        <OAuth img={google}>Google</OAuth>
        <OAuth img={facebook}>Facebook</OAuth>
      </div>
    </form>
  );
};

export default SignIn;
